import { Fragment } from "react";
import Products from "./components/Products";
import AddProduct from './store/AddProduct'
import { Router, RouterProvider, createBrowserRouter, createRoutesFromElements } from "react-router-dom";
import ViewDetails from "./components/ViewDetails";

function App() {

    const router = createBrowserRouter(createRoutesFromElements(
        <Router>
            <Router path='/' element={<AddProduct/>} />
            <Router path='product/:id' element={<ViewDetails/>}/>
            <Router path='product/edit/:id' element={<UpdateProduct/>}/>


        </Router>))
        return (
            <RouterProvider router={router}/>
        )

        }

    
export default App;
